.Rise-popup .Rise-popup-close-button {
  background-color: unset;
  background-image: url(https://assets.rise-ai.com/static/3c5f3083e19b40e9a4b8750b4e292998a629107af12d4c4e9428093279dea76f.png);
  background-repeat: no-repeat;
  background-position: center;
  background-size: 14px;
  padding: 16px;
  border-radius: 3px;
  -webkit-transition: all 0.2s;
  -o-transition: all 0.2s;
  transition: all 0.2s;
  position: fixed;
  right: 15px;
  top: 15px;
  cursor: pointer;
  border: 0;
  outline: none;
  z-index: 2147483647;
}
.Rise-popup .Rise-popup-close-button.Rise-popup-close-button--light {
  background-image: url(https://assets.rise-ai.com/static/4b4ebf85a9424d43a6b0bd6ce2143d7d.png);
}
@media (min-width: 40em) {
  .Rise-popup .Rise-popup-close-button {
    background-size: 18px;
    padding: 18px;
  }
}
.Rise-popup .Rise-popup-close-button:hover {
  background-color: rgba(209, 209, 209, 0.5);
}
.Rise-popup iframe {
  border: none;
  outline: 0;
  height: 100%;
  width: 100%;
  display: none;
  overflow-y: scroll;
  -webkit-overflow-scrolling: touch;
}
.Rise-popup .Rise-popup-spinner {
  position: absolute;
  left: 50%;
  top: 50%;
  -webkit-transform: translate(-50%, -50%);
  -ms-transform: translate(-50%, -50%);
  transform: translate(-50%, -50%);
}
.Rise-popup .Rise-popup-spinner > svg {
  -webkit-animation: spinner 500ms linear infinite;
  animation: spinner 500ms linear infinite;
  height: 40px;
  width: 40px;
}
@-webkit-keyframes spinner {
  to {
    -webkit-transform: rotate(360deg);
    transform: rotate(360deg);
  }
}
@keyframes spinner {
  to {
    -webkit-transform: rotate(360deg);
    transform: rotate(360deg);
  }
}
.Rise-popup-backdrop {
  position: fixed;
  top: 0;
  bottom: 0;
  left: 0;
  right: 0;
  width: 100%;
  height: 100%;
  overflow: hidden;
  pointer-events: none;
  opacity: 0;
  -webkit-transition: all 0.3s;
  -o-transition: all 0.3s;
  transition: all 0.3s;
  z-index: -999;
}
.Rise-popup-backdrop.show {
  z-index: 2147483647;
  pointer-events: all;
  opacity: 1;
  background: rgba(0, 0, 0, 0.13);
}
